def findContentChildren(g, s):
    """
    :type g: List[int]
    :type s: List[int]
    :rtype: int
    """
    x = sorted(g)
    cnt = 0
    j = 0
    tmp = sorted(s)
    for i in range(len(x)):
        while j < len(tmp):
            if tmp[j] >= x[i]:
                cnt += 1
                tmp = tmp[j + 1:]  # take out the ones less than current one
                j = 0
                break
            j += 1

    return cnt



